    if (rst_r1) begin
        wr_data_buffer_b0 <=   'h0 ;
        wr_data_buffer_b1 <=   'h0 ;
        wr_data_buffer_b2 <=   'h0 ;
        wr_data_buffer_b3 <=   'h0 ;
        wr_data_buffer_b4 <=   'h0 ;
        wr_data_buffer_b5 <=   'h0 ;
