    for (phaseNum = 0; phaseNum <= 7; phaseNum = phaseNum + 1) begin
        wr_data_reorder[(phaseNum*DQ_WIDTH + 0*8) +: 8] =  wr_data_buffer_b0[phaseNum*8 +: 8];
