    dfi_rddata                <= dfi_rddata_temp       ;
    dfi_rddata_dbi_n          <= dfi_rddata_dbi_n_temp ;

`ifdef USE_PAR_ALERT
    dfi_alert_n               <= dfi_alert_n_temp      ;
`endif
end

end // end of PIPELINE STAGE
endgenerate

